INSERT INTO `grouplist` VALUES (328, 274, 500, '{01}Action', 0, 0, 0, '\\cat\\General\\desc\\Action servers are focused heavily on action gaming. Expect very little dialogue and a great number of creatures to fight through.\\filter\\@01action', 0, 0);
INSERT INTO `grouplist` VALUES (328, 275, 500, '{02}Roleplaying', 0, 0, 0, '\\cat\\General\\desc\\Roleplaying servers are driven by characters. Expect heavy dialogue and fewer combat situations.  Character development will require more than leveling up.\\filter\\@02roleplaying', 0, 0);
INSERT INTO `grouplist` VALUES (328, 276, 500, '{03}Team (N vs. N)', 0, 0, 0, '\\cat\\General\\desc\\Team servers feature group-based combat. This can be dungeon races or simple group vs group combat scenarios.\\filter\\@03team', 0, 0);
INSERT INTO `grouplist` VALUES (328, 277, 500, '{04}Social', 0, 0, 0, '\\cat\\General\\desc\\Social servers take many forms, from chat rooms to taverns.  A great place to meet others and create new friendships.\\filter\\@04social', 0, 0);
INSERT INTO `grouplist` VALUES (328, 278, 500, '{05}Persistent World Action', 0, 0, 0, '\\cat\\General\\desc\\Persistent World Action servers are driven mainly by character progression. Expect lots of combat within a persistent world.\\filter\\@05pwaction', 0, 0);
INSERT INTO `grouplist` VALUES (328, 279, 500, '{06}Alternative', 0, 0, 0, '\\cat\\General\\desc\\Alternative servers are running games which do not adequately fit into the other categories. Expect the unexpected.\\filter\\@06alternative', 0, 0);
INSERT INTO `grouplist` VALUES (328, 363, 500, '{07}Story', 0, 0, 0, '\\cat\\General\\desc\\Story servers feature full features storytelling. Expect large amounts of dialogue and puzzle solving with medium levels of combat.\\filter\\@07story', 0, 0);
